// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import '@openzeppelin/contracts/access/Ownable.sol';

/**
 * @title SimpleEcoLedger Contract
 * @dev A simple contract for tracking eco-friendly products on VeChain
 * This is a basic version that we can extend later
 */
contract SimpleEcoLedger is Ownable {
    
    // Product structure
    struct Product {
        string name;
        string category;
        string description;
        uint256 emissionFactor; // kg CO2 per kg (scaled by 1000)
        uint256 ecoScore; // 0-100
        uint256 timestamp;
        address owner;
        bool exists;
    }
    
    // State variables
    uint256 public totalProducts;
    mapping(uint256 => Product) public products;
    mapping(address => uint256[]) public userProducts;
    
    // Events
    event ProductAdded(
        uint256 indexed productId,
        string name,
        string category,
        uint256 emissionFactor,
        uint256 ecoScore,
        address owner
    );
    
    event ProductUpdated(
        uint256 indexed productId,
        string name,
        uint256 ecoScore
    );
    
    // Constructor
    constructor() Ownable(msg.sender) {
        totalProducts = 0;
    }
    
    // Add a new product
    function addProduct(
        string memory _name,
        string memory _category,
        string memory _description,
        uint256 _emissionFactor,
        uint256 _ecoScore
    ) external returns (uint256) {
        require(bytes(_name).length > 0, "Product name cannot be empty");
        require(_emissionFactor > 0, "Emission factor must be greater than 0");
        require(_ecoScore >= 0 && _ecoScore <= 100, "Eco score must be between 0 and 100");
        
        totalProducts++;
        uint256 productId = totalProducts;
        
        products[productId] = Product({
            name: _name,
            category: _category,
            description: _description,
            emissionFactor: _emissionFactor,
            ecoScore: _ecoScore,
            timestamp: block.timestamp,
            owner: msg.sender,
            exists: true
        });
        
        userProducts[msg.sender].push(productId);
        
        emit ProductAdded(productId, _name, _category, _emissionFactor, _ecoScore, msg.sender);
        
        return productId;
    }
    
    // Get product information
    function getProduct(uint256 _productId) external view returns (
        string memory,
        string memory,
        string memory,
        uint256,
        uint256,
        uint256,
        address
    ) {
        require(products[_productId].exists, "Product does not exist");
        
        Product memory product = products[_productId];
        return (
            product.name,
            product.category,
            product.description,
            product.emissionFactor,
            product.ecoScore,
            product.timestamp,
            product.owner
        );
    }
    
    // Get user's products
    function getUserProducts(address _user) external view returns (uint256[] memory) {
        return userProducts[_user];
    }
    
    // Update eco score (only by owner)
    function updateEcoScore(uint256 _productId, uint256 _newEcoScore) external {
        require(products[_productId].exists, "Product does not exist");
        require(products[_productId].owner == msg.sender, "Only product owner can update");
        require(_newEcoScore >= 0 && _newEcoScore <= 100, "Eco score must be between 0 and 100");
        
        products[_productId].ecoScore = _newEcoScore;
        
        emit ProductUpdated(_productId, products[_productId].name, _newEcoScore);
    }
    
    // Get contract statistics
    function getStats() external view returns (uint256, uint256, uint256) {
        uint256 totalEmissionFactor = 0;
        uint256 totalEcoScore = 0;
        
        for (uint256 i = 1; i <= totalProducts; i++) {
            if (products[i].exists) {
                totalEmissionFactor += products[i].emissionFactor;
                totalEcoScore += products[i].ecoScore;
            }
        }
        
        return (totalProducts, totalEmissionFactor, totalEcoScore);
    }
}

